import RestaurantInfo from '../../components/RestaurantInfo/restaurantInfo.js';
import Footer from '../../components/Footer/footer.js'

class SearchFood extends React.Component {
  constructor(props){
    super(props);

    };

    render(){

      goHome = () => {
        // to send info to the server, we need to make a post.
        // control of data with ifs.
        window.location.href = '/home';
    
        var BodyString = { 
          method: 'GET',
          email: this.state.email,
          pass: this.state.pass,
        }
    
        fetch('http://google.com')
        .then(response => {
          console.log(response);
        }).catch(error => {
          console.log(error);
        })
      }
      return (
        <div className="mainRestaurant">
          <div className="backgroundImageTop">
          </div>
          <div className="filters">
            <div className="items_filters">
                <a>hola</a>
            </div>
          </div>
          <div className="component">
          <RestaurantInfo />
          </div>
          <Footer/>
        </div>
      );
    }
};


export default SearchFood;
